import React from "react";

function CardPage() {
  return (
    <article className="element">
      <figure className="element__container">
        <img className="element__image" alt="Bathroom" />
        <figcaption>
          <h2 className="element__title">Bathroom</h2>
        </figcaption>
      </figure>
    </article>
  );
}

export default CardPage;
